How to fix this function, to retrieve data contain search keywords?<p>I'm developing website using MERN stack technologies. In that application I want to provide search facility. There is text box search button next to it. I want to open search results in new page. For example,</p>

<p>Data table contains products. If some user type 'milk' and click on search new page should show all milk product details.</p>

<p>when I click on search button it updated browser URL to this,</p>

<blockquote>
  <p><a href="http://localhost:3000/search_result/this_is_search_string" rel="nofollow noreferrer">http://localhost:3000/search_result/this_is_search_string</a></p>
</blockquote>

<p>This is the frontend code,</p>

<pre><code>&lt;form className="form-inline"&gt;
&lt;input type="text"
  className="form-control"
  value={this.state.name}
  onChange={this.on_change_name}/&gt;
&lt;Link to={'/search_result/'+this.state.name} className="btn btn-primary"&gt;Search&lt;/Link&gt; 
&lt;/form&gt;
</code></pre>

<p>First problem is URL updated when click on button, but it not redirect to new page.
In search_result page componentDidMount() method looks like this,</p>

<pre><code>componentDidMount(){
        axios.get('http://localhost:4000/item/')
            .then(response =&gt; {
                this.setState({ search_result: response.data });
            })
            .catch(function (error) {
                console.log(error);
            })
    }
</code></pre>

<p>I want to pass url appended value to above function' 2nd line,
<code>axios.get('http://localhost:4000/item/')</code> end of <code>/item/</code>.  So I could load retrieved values to table.</p>

<p>Also in the backend controller file' method look like this.</p>

<pre><code>export const get_items_by_name=(req,res)=&gt;{
    //Item.find(req.params.id,(err,item)=&gt;{{name: "Renato"}
    Item.find({name: "a"},(err,item)=&gt;{
        if(err){
            res.send(err);
        }
        res.json(item);
    });
};
</code></pre>

<p>In SQL there is a way to perform select query with LIKE. But I'm new to MERN stack. So how could I update above method to search and retrieve values as URL appended.</p>

<p>I need your help guys how to figure out this. Thank for your help specially with implementation support.</p>

