Is it possible to exclude/negate a phrase in mongo text search?<p>Related to <a href="https://stackoverflow.com/questions/23985464/how-to-and-and-not-in-mongodb-text-search">How to AND and NOT in MongoDB $text search</a></p>

<p>Using the same document words collection for example:  </p>

<pre><code>{ "text" : "cake" }
{ "text" : "sale" }
{ "text" : "sale cake" }
{ "text" : "cake sale" }
{ "text" : "dress sale" }
{ "text" : "cake sale monday" }
</code></pre>

<p><strong>Is it possible to somehow explicitly negate the search phrase (not only one word), the following doesn't work when quoting the phrase:</strong>  </p>

<pre><code>db.words.find( { "$text": { "$search": "-\"cake sale\"" } },{_id: 0})
</code></pre>

<p>Notice the minus sign (attempt of negation) <code>"-\"cake sale\""</code> as an intention to exclude documents containing exact phrase from result set.  </p>

<p>Only way i can handle this is in further aggregation by using <code>$regex</code> to exclude already retrieved results from text search step.</p>

